import Item from "./components/Item";
function App() {
  let item_date = new Date("2022-12-20");
  let item_name = "Car insurance";
  let item_price = 500;
  return (
    <div className="list">
      <center>
        <h1 className="head">EXPENSE TRACKER</h1>
      </center>
      <Item date={item_date} name={item_name} price={item_price}></Item>;
      <Item date={item_date} name={item_name} price={item_price}></Item>;
      <Item date={item_date} name={item_name} price={item_price}></Item>;
    </div>
  );
}
export default App;
